import styled from '@emotion/styled';

export const Div = styled.div`
  display: flex;
  margin: 20px;
  justify-content: flex-end;
`;

export const P = styled.p`
  font-weight: bold;
  font-size: 30px;
`;

export const Button = styled.button`
  background-color: #d0a686;
`;
